description:
This is one of the later serials in 15 episodes from 1952 in glorious Black and White.

A flying squadron of World War Two veterans, The International Brotherhood, led by Blackhawk (Kirk Alyn), an organization dedicated to the freedom of mankind worldwide, uncovers an underworld gang, led by the notorious Laska (Carol Forman) who reports to a mystery man known as The Leader (Michael Fox), and sets about bringing the criminals to justice.
- Written by Les Adams &lt;  &gt;
